import { BrowserRouter } from "react-router-dom"
import { Routing } from "./Routing"
import './style.css'
import { useEffect } from "react"
import { useDispatch } from "react-redux"
import { addCar, addDriveType, addModel, setCarModels, setCars, setCarTypes, setDriveType, setRentals } from "../redux/Actions"
import { getCarTypes } from "../Functions/ApiRequests/CarTypes"
import { getDriveTypes } from "../Functions/ApiRequests/DriveTypes"
import { getRentals } from "../Functions/ApiRequests/Rentals"
import { getCars } from "../Functions/ApiRequests/Cars"
import { getCarModels } from "../Functions/ApiRequests/CarModel"
import { resetCarModels } from "../Functions/ApiRequests/reset/CarModels"
import { resetCars } from "../Functions/ApiRequests/reset/cars"

export const Main = () => {

    let dis = useDispatch()

    useEffect(() => {
        // getCarModels()
        //     .then(x => {
        //         dis(setCarModels(x.data))
        //     })
        //     .catch(error => {
        //         console.log(error.message);
        //     })

        resetCarModels(dis=dis)

        getCarTypes()
            .then(x => {
                dis(setCarTypes(x.data))
            })
            .catch(error => {
                console.log(error.message);
            })

        getDriveTypes()
            .then(x => {
                dis(setDriveType(x.data))
            })
            .catch(error => {
                console.log(error.message);
            })

        getRentals()
            .then(x => {
                dis(setRentals(x.data))
            })
            .catch(error => {
                console.log(error.message);
            })

        resetCars(dis=dis)
    }, [])

    if (!sessionStorage.getItem("isFirstLogin")) {
        sessionStorage.setItem("currentUser", JSON.stringify(null))
        sessionStorage.setItem("isFirstLogin", true)
    }

    return <>
        <BrowserRouter>
            <Routing></Routing>
        </BrowserRouter>
    </>
}
